import React from "react";
import { NavLink } from "react-router-dom";

function NavBar() {
    return (
        <div>
            <p>NavBar</p>
            <NavLink to="/">Home Logo</NavLink>
            <NavLink to="/marketplace">Marketplace</NavLink>
        </div>
    )
}

export default NavBar;
